import { ReaderItem } from "../../../organisms/constants/ItemReader";
export function totalPrice(items,count)
{
    let totalSum=0

    items.forEach((item) => {
        totalSum+= Number((count.get(ReaderItem.getId(item))))
    })
    return totalSum;
}
